main/gl/default.fragment:
#ifdef GL_ES
precision highp float;
#endif

varying vec2 vTextureCoords;
uniform sampler2D uTextureOne;
uniform float uGlobalAlpha;

void main(void) {
  vec4 colour = texture2D(uTextureOne, vec2(vTextureCoords.s, vTextureCoords.t));
  gl_FragColor = vec4(colour.r, colour.g, colour.b, uGlobalAlpha * colour.a);
}

main/gl/default.shader:
attribute vec3 aVertexPosition;
attribute vec2 aTextureCoords;

uniform mat4 uProjection;
uniform mat4 uView;
uniform mat4 uWorld;

varying vec2 vTextureCoords;

void main(void) {
  gl_Position =  uProjection * uView * uWorld * vec4(aVertexPosition, 1.0);
  vTextureCoords = aTextureCoords;
}
